const IMAGES = {
    card: require("../assets/images/card.png"),
    error404: require("../assets/images/error404.png"),
    extract: require("../assets/images/extract.png"),
    globe: require("../assets/images/globe.png"),
    hand_globe: require("../assets/images/hand-globe.png"),
    help: require("../assets/images/help.png"),
    home: require("../assets/images/home.png"),
    leaf: require("../assets/images/leaf.png"),
    logo: require("../assets/images/logo.png"),
    pen: require("../assets/images/pen.png"),
    piggy_bank: require("../assets/images/piggy-bank.png"),
    save_money: require("../assets/images/save-money.png"),
    search: require("../assets/images/search.png"),
    transfer: require("../assets/images/transfer.png"),
    user: require("../assets/images/user.png"),
    wallet: require("../assets/images/wallet.png"),
};

const GIFS = {
    loading_buffering: require("../assets/gifs/loading-buffering.gif"),
};

const ASSETS = {
    IMAGES,
    GIFS,
};

export default ASSETS;
